import React from "react";
import { Link } from "react-router-dom";

const RegisteredUserHomepage = () => {
  return (
    <React.Fragment>
      <h1>Home Page</h1>
      <Link className="btn btn-primary" to="/registeredUserProfile">
        My profile
      </Link>
    </React.Fragment>
  );
};

export default RegisteredUserHomepage;
